exports=async function(url,bid,cid,options){const{parseContentPaginate}=await require("transcode/parse_content");return parseContentPaginate(page=>1===page?url:url.replace(".html",`_${page-1}.html`),"#chaptercontent",{clientOptions:{...(options&&options.clientOptions)},hasNextFn:html=>null!=/id="next_url" href="\/read\/\d+\/\d+\/\d+_\d+\.html"/.exec(html)})};